import React from 'react';

const Checkout = () => {
  // Generate today's date in a readable format
  const today = new Date();
  const options = { year: 'numeric', month: 'long', day: 'numeric' };
  const formattedDate = today.toLocaleDateString('en-US', options);

  // Placeholder for reservations data. This should be fetched or derived from your app's state
  const reservationsDueToday = [
    // Example reservation object
    // { id: '12345', vehicleInfo: 'Tesla Model S', customerInfo: 'John Doe' },
  ];

  return (
    <div className="mt-8 mr-10 ml-10">
      <h2 className="p-4 font-serif mb-4">Today's Scheduled Returns - {formattedDate}</h2>
      <table className="min-w-full">
        <thead>
          <tr className="bg-gray-100">
            <th className="px-4 py-2 border">Reservation ID</th>
            <th className="px-4 py-2 border">Vehicle Information</th>
            <th className="px-4 py-2 border">Customer Information</th>
            <th className="px-4 py-2 border">Actions</th>
          </tr>
        </thead>
        <tbody>
          {reservationsDueToday.length > 0 ? (
            reservationsDueToday.map((reservation) => (
              <tr key={reservation.id}>
                <td className="px-4 py-2 border">{reservation.id}</td>
                <td className="px-4 py-2 border">{reservation.vehicleInfo}</td>
                <td className="px-4 py-2 border">{reservation.customerInfo}</td>
                <td className="px-4 py-2 border text-center">
                  <button 
                    className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                    Initiate Check-Out
                  </button>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="4" className="text-center py-3">No reservations are due for return today.</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default Checkout;
